const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Rancher 2.3.4 版本于 2020 年 1 月 17 日发布。本文介绍了 Rancher 2.3.4 相较上一版本（2.3.3）的重大改动、新增的实验性功能、已修复的问题和已知问题。单击`}<a parentName="p" {...{
        "href": "https://github.com/rancher/rancher/releases/tag/v2.3.4"
      }}>{`这里`}</a>{`查看英文版版本说明。`}</p>
    <h2 {...{
      "id": "重要说明"
    }}>{`重要说明`}</h2>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`如果您打算从 v2.2 版本升级到该版本，请务必查看`}<a parentName="p" {...{
            "href": "/docs/rancher2/releases/v2.3.0"
          }}>{`v2.3.0 版本说明`}</a>{`中的重要更新和重大改动的说明。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`为了支持 v0.12.0 版本的 cert-manager，我们针对 2.2.x 系列的版本发布了新的 Helm chart。底层的 Rancher Server 容器仅针对新版 cert-manager 的改动做了相应修改。如果您在用旧版本的 cert-manager，请查看`}<a parentName="p" {...{
            "href": "/docs/rancher2/installation/options/upgrading-cert-manager/_index"
          }}>{`这个文档`}</a>{`来获取有关如何升级 cert-manager 的方法。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`离线用户`}</strong>{` - Rancher 中的 Istio 1.4.3 版本在离线环境下不可用，我们将在下一个版本修复这个问题。`}</p>
      </li>
    </ul>
    <p>{`下面的版本为当前的最新版和稳定版：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Rancher 版本`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Docker 标签`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Helm 仓库`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Helm Chart 版本`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`最新版`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`v2.3.4`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`rancher/rancher:latest`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`server-charts/latest`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`v2.3.4`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`稳定版`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`v2.3.4`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`rancher/rancher:stable`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`server-charts/stable`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`v2.3.4`}</td>
        </tr>
      </tbody>
    </table>
    <p>{`您可以通过`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/options/server-tags/_index"
      }}>{`如何选择版本的文档`}</a>{`，了解更多关于不同版本和标签的区别。`}</p>
    <h2 {...{
      "id": "功能和优化"
    }}>{`功能和优化`}</h2>
    <ul>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`默认 Kubernetes 版本为 1.17`}</strong>{` [`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/23088"
          }}>{`#23088`}</a>{`] [`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/22655"
          }}>{`#22655`}</a>{`]`}</p>
        <ul parentName="li">
          <li parentName="ul">{`Kubernetes 1.17 被设置为了默认版本。在任何时候，如果您要升级 Kubernetes 版本，请务必查看 Kubernetes 官方到版本说明，从而了解 Kubernetes 版本中的重大变化。Kubernetes 1.17 中支持了 etcd 3.4.x 版本和 calico 3.10.x 版本`}</li>
        </ul>
      </li>
      <li parentName="ul">
        <p parentName="li"><strong parentName="p">{`其他更新`}</strong></p>
        <ul parentName="li">
          <li parentName="ul">{`EKS 支持 Canada Central 区域 [`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/24299"
            }}>{`#24299`}</a>{`] 和 Sao Paulo 区域 [`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/24400"
            }}>{`#24400`}</a>{`]`}</li>
          <li parentName="ul">{`升级 Istio 版本到 1.4.3`}</li>
        </ul>
      </li>
    </ul>
    <h2 {...{
      "id": "实验性功能"
    }}>{`实验性功能`}</h2>
    <p>{`我们提供了一种启停 Rancher 中实验性功能模块的能力。在这个版本里，您可以通过 UI 来控制“功能开关”。详情请查阅`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/options/feature-flags/_index"
      }}>{`在 Rancher 中如何开启某些功能`}</a>{`的文档。`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rancher2/installation/options/feature-flags/enable-not-default-storage-drivers/_index"
        }}>{`在 UI 中启用非默认激活的存储驱动（例如：Ceph）`}</a></li>
    </ul>
    <h2 {...{
      "id": "自-v233-以来修复的主要问题"
    }}>{`自 v2.3.3 以来修复的主要问题`}</h2>
    <ul>
      <li parentName="ul">{`修复了很多关于 vSphere 主机驱动的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24304"
        }}>{`#24304`}</a>{`，`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24314"
        }}>{`#24314`}</a>{`，`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24315"
        }}>{`#24315`}</a>{`，`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24416"
        }}>{`#24416`}</a>{`，`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24453"
        }}>{`#24453`}</a>{`，`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24480"
        }}>{`#24480`}</a>{`，`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24620"
        }}>{`#24620`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个离线环境下，如果系统镜像库需要认证的话，无法成功创建集群的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/20029"
        }}>{`#20029`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个回滚 Rancher 时，对应的 Rancher agent 没有被回滚的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/21386"
        }}>{`#21386`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个轮换证书可能导致 Rancher Server 异常退出的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24097"
        }}>{`#24097`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个无法通过 kontainer-driver-metadata 更新 RKE Addons 的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24675"
        }}>{`#24675`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个无法通过代理创建 GKE 集群的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/22006"
        }}>{`#22006`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个无法在集群内设置 Pod MTU 的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24096"
        }}>{`#24096`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个无法在采集到的日志里将 json 格式日志合并作为顶层键的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/23646"
        }}>{`#23646`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个激活集群日志后，日志向 Fluentd 目标发送的日志内容中包含大量反斜杠的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24545"
        }}>{`#24545`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个如果一个 role 已经继承了其他角色，那么更新这个 role 的时候，Rancher 不会更新对应的 rolebindings 的问题[`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/23658"
        }}>{`#23658`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个无法给导入集群中的节点添加标签的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24123"
        }}>{`#24123`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个在 AWS 密钥被删除或者停用后，即使更新了节点模版，也无法删除节点的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24234"
        }}>{`#24234`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个对接 Google 认证时，nested groups 信息丢失的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24334"
        }}>{`#24334`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个 Rancher HA 在设置了反亲和性为必须时，无法升级的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24518"
        }}>{`#24518`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个 FreeIPA 认证时，添加组成员时不能进行模糊搜索的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/18927"
        }}>{`#18927`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个通过 UI 或 API 删除节点注解后，无法再加回来的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24869"
        }}>{`#24869`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个再应用商店模板名称很长的时候，导致应用商店刷新超时的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/19724"
        }}>{`#19724`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个通过 Rancher 命令行部署应用时，如果 yaml 中包括的整数超过 6 位，那么它将被转化为科学计数法的形式的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/20704"
        }}>{`#20704`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个在添加应用商店时，界面上显示证书错误，无法成功添加应用商店的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/23231"
        }}>{`#23231`}</a>{`, `}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24347"
        }}>{`#24347`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个由于错误的应用商店模板名格式，导致应用商店不停刷新的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/23368"
        }}>{`#23368`}</a>{`]`}</li>
      <li parentName="ul">{`修复了一个测试邮件通知连通性的时候，请求是从 Rancher Server 所在集群发出，而不是在所配置通知的下游集群发出的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/22578"
        }}>{`#22578`}</a>{`]`}</li>
    </ul>
    <h2 {...{
      "id": "其他说明"
    }}>{`其他说明`}</h2>
    <h3 {...{
      "id": "离线安装和升级"
    }}>{`离线安装和升级`}</h3>
    <p>{`在 v2.3.0+的版本里，离线安装将不在需要手动同步 system charts 的源代码仓库了。具体操作请参阅有关`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/other-installation-methods/air-gap/install-rancher/_index"
      }}>{`安装 Rancher 时，如何使用内嵌的 system charts`}</a>{`。`}</p>
    <h3 {...{
      "id": "主要的已知问题"
    }}>{`主要的已知问题`}</h3>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`k8s 1.16 在 RHEL 7.7 启用 selinux 后无法正常工作 [`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/23662"
          }}>{`#23662`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`NGINX ingress controller 0.25.0 版本仅支持有 SSE4.2 指令集的 CPU [`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/23307"
          }}>{`#23307`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Windows 集群限制 - 由于其他上游依赖的原因，Windows 集群有一些已知的限制：`}</p>
        <ul parentName="li">
          <li parentName="ul">{`在使用 Flannel VXLAN (Overlay) 模式时， Windows Pods 无法访问 Kubernetes API。临时解决方案是使用 Flannel Host Gateway (L2bridge)模式。该问题将在 k8s 1.18 版本中修复。[`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/20968"
            }}>{`#20968`}</a>{`]`}</li>
        </ul>
        <ul parentName="li">
          <li parentName="ul">{`Windows 集群的日志功能仅在 Flannel Host Gateway (L2bridge)模式下可以使用。该问题将在 k8s 1.18 版本中修复。[`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/20510"
            }}>{`#20510`}</a>{`]`}</li>
        </ul>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Istio 限制 - Istio 无法在使用受限的 Pod 安全策略的集群中激活 [`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/22469"
          }}>{`#22469`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`HPA 限制 - 因为 GKE 不支持`}<inlineCode parentName="p">{`v2beta2.autoscaling`}</inlineCode>{`版本的 API。所以在 Rancher UI 中无法通过 UI 管理 GKE 集群的 HPA 资源。[`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/22292"
          }}>{`#22292`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`安全加固限制 - 如果您按照 Rancher 的安全加固手册进行了配置，那么您将会遇到一些已知的问题。`}</p>
        <ul parentName="li">
          <li parentName="ul">{`Rancher UI 中的 kubectl 将无法工作 [`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/19439"
            }}>{`#19439`}</a>{`]`}</li>
          <li parentName="ul">{`流水线将无法工作 [`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/22844"
            }}>{`#22844`}</a>{`]`}</li>
        </ul>
      </li>
      <li parentName="ul">
        <p parentName="li">{`如果您是从 v2.2 升级上来的环境，在向已有节点模版中添加的 Taints 后，并使用这个节点模版来扩容 Worker 节点，那么这些新的 Worker 节点可能无法正常工作。您必须在对管理节点或 etcd 节点进行扩缩容后，或是对集群进行编辑后，这些带有 Taints 的新 Worker 节点才能正常工作。因为只有在集群 Reconcile 被触发后，系统组件才会自动添加 Tolerations [`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/22672"
          }}>{`#22672`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
